function searchPairsByPrefix(a){var r="";for(let e=0;e<localStorage.length;e++){const t=localStorage.key(e);if(t.startsWith(a)){const a=localStorage.getItem(t),e=t.split(","),o=e[e.length-1];r+="<span class='history'><a target='popout' href='"+a+"'>"+o+"</a></span> "}}return r}var url=window.location.href;try{for(var a,b,c,queryString=url.split("?")[1],queryParams=queryString.split("&"),i=0;i<queryParams.length;i++){var param=queryParams[i].split("=");switch(param[0]){case"a":a=param[1];break;case"b":b=param[1];break;case"c":c=param[1];break;case"d":d=param[1]}}a&&b&&c&&d?(localStorage.setItem("link,"+a,url),localStorage.setItem("pap",b),localStorage.setItem("papIndex",c),localStorage.setItem("logo",d)):console.error("One or more required parameters not found.")}catch{console.log("no parameters to parse")}try{var linko=searchPairsByPrefix("link");document.getElementById("linko").innerHTML=linko}catch{console.log("no links")}